import React, {Component} from 'react';

class Nav extends Component {
  render(){
    let menus = [];
    let datas = this.props.data;

    datas.forEach(data =>
      menus.push(
        <li key={data.id}>
          <a
            href={"/content/" + data.id}
            onclick={()=>(console.log(1))}
          >
            {data.title}
          </a>
        </li>)
    )

    return(
      <nav>
        <ul>
          {menus}
        </ul>
      </nav>
    )
  }
}

export default Nav;
